import "../App.css";
import CarouselFadeExample from "../components/carousel";
import CardTemplate from "../components/cards";
import Footer from "../components/footer";

function Home() {
  return (
    <>
      <h1>DTNS News Blog</h1>

      <CarouselFadeExample />
      <CardTemplate />
      <Footer />
    </>
  );
}

export default Home;
